  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains the 1996-era and
  2001-era classifications of Great lakes and can be used to analyze change. This
  imagery was collected as part of the Multi-Resolution Land Characteristics program
  in a multi-agency effort to provide baseline multi-scale environmental characteristics
  and to monitor environmental change. This data set utilized 35 (1996-era) and 74
  (2001-era) full or partial Landsat 5 and 7 scenes which were analyzed according
  to the Coastal Change Analysis Program (C-CAP) protocol to determine land cover.\",\n\t\"license_title\":
